Lesson: CSS3 Styling and Layout
Course: Web Development with HTML & CSS
Content: # CSS3 Styling and Layout

CSS (Cascading Style Sheets) controls the visual presentation of HTML elements.

## CSS Syntax
```css
selector {
    property: value;
}
```

## Selectors
```css
/* Element selector */
p { color: blue; }

/* Class selector */
.highlight { background: yellow; }

/* ID selector */
#header { font-size: 24px; }

/* Descendant selector */
nav a { text-decoration: none; }
```

## Box Model
```css
.box {
    width: 200px;
    padding: 20px;
    border: 1px solid black;
    margin: 10px;
}
```

## Flexbox Layout
```css
.container {
    display: flex;
    justify-content: center;
    align-items: center;
    gap: 20px;
}
```

## CSS Grid
```css
.grid-container {
    display: grid;
    grid-template-columns: repeat(3, 1fr);
    gap: 20px;
}
```

## Responsive Design
```css
@media (max-width: 768px) {
    .container {
        flex-direction: column;
    }
}
```
